export default {
  SET_NEWS(state, news) {
    state.news = news;
  },
  SET_ASK(state, ask_items) {
    state.ask_items = ask_items;
  },
  SET_JOBS(state, jobs) {
    state.jobs = jobs;
  },
  SET_LIST(state, list) {
    state.list = list
  },
  SET_USER(state, user) {
    state.user = user;
  },
  SET_ITEM(state, item) {
    state.item = item;
  }
}
